import './css/Turtle.css';
import React from 'react';

export default function Turtle() {
    return(
        <div>
            <div className='San' />
            <ellipse className='Namu1' />
            <ellipse className='Namu2' />
            <ellipse className='Namu3' />
            <ellipse className='Namu4' />
            <ellipse className='Namu5' />
            <ellipse className='pul' />
            <div className='menu'>
                <p className='pageName'>거북이 수족관</p>
                <p className='logOut'>로그아웃</p>
            </div>
        </div>

    )
}
